import "./App.css";
import denverpic from "./assets/img/DenverJam_poster.png";
import guitarpic from "./assets/img/egtr.jpeg";
import Marquee from "react-fast-marquee";
import { fontSize } from "@mui/system";

function App() {
  return (
    <div className="App">
      <div className="headercontainer">
        <img
          alt="Denver Open Jam - Come Play With Local Musicians"
          className="headerpic"
          src={denverpic}
        ></img>
        <div className="marqueecontainer">
          <Marquee pauseOnHover="true" speed="30" gradient="">
            <span className="scrolltext">* Location and Date TBD *</span>
          </Marquee>
        </div>
      </div>
      <div className="maincontainer">
        <div className="contentcontainer">
          <span>
            JOIN DENVER'S BEST MUSICIANS FOR A NIGHT OF FUN AND RELAXED JAMMING!{" "}
          </span>
          <img className="mainpic" src={guitarpic}></img>
          <span className="abouttext">
            Looking to get out and play? Go ahead, brush off the dust from that
            guitar that's been sitting in a corner for two years. 
          </span>
        </div>
      </div>
    </div>
  );
}

export default App;
